package devops.ecom.productservice.service;

import devops.ecom.productservice.dao.entities.Dimension;
import devops.ecom.productservice.dao.entities.PageInfo;
import devops.ecom.productservice.dao.entities.Price;
import devops.ecom.productservice.dao.entities.Product;
import devops.ecom.productservice.dao.enums.Colors;
import devops.ecom.productservice.dao.enums.Currency;
import devops.ecom.productservice.dao.enums.ProductCategory;
import devops.ecom.productservice.dao.enums.ProductStatus;
import devops.ecom.productservice.dao.repos.PriceRepo;
import devops.ecom.productservice.dao.repos.ProductRepo;
import org.springframework.data.domain.PageRequest;
import org.springframework.stereotype.Service;
import org.springframework.transaction.annotation.Transactional;

import java.util.Date;
import java.util.List;
import java.util.UUID;

@Service
@Transactional
public class ProductServiceImpl implements ProductService {
    private ProductRepo productRepo ;
    private PriceRepo priceRepo ;

    public ProductServiceImpl(ProductRepo productRepo, PriceRepo priceRepo) {
        this.productRepo = productRepo;
        this.priceRepo = priceRepo;
    }

    @Override
    public Product createProduct(Product product, Price price) {
        price.setPriceId(UUID.randomUUID().toString());
        product.setProductId(UUID.randomUUID().toString());
        product.setAddingDate(new Date());
        Price insertdPrice = this.priceRepo.insert(price);
        product.setProductPrice(insertdPrice);
        return this.productRepo.insert(product);
    }

    @Override
    public Product updateProduct(Product product) {
        product.setAddingDate(new Date());
        Product saved = this.productRepo.save(product);
        return saved;
    }

    @Override
    public void deleteProduct(String productId) {
        this.productRepo.deleteById(productId);
    }

    @Override
    public Product getProductById(String productId) {
        return null;
    }

    @Override
    public List<Product> getProductsByCategory() {
        return null;
    }

    @Override
    public List<Product> getProductsByName(String name) {
        return null;
    }

    @Override
    public List<Product> getAllProduct() {
        return productRepo.findAll();
    }

    @Override
    public List<Product> getProductPage(int page, int size) {
        return null;
    }

    @Override
    public void initProduct() {
        Dimension dimension = new Dimension(20 , 10 ,20  , 0.75) ;
        for (int i = 0; i < 10; i++) {
            Price price = Price.builder().currency(Currency.MAD)
                    .price((long) (Math.random() * 100 + 100))
                    .symbol("MAD")
                    .build();
            Product product = Product.builder()
                    .productPrice(price)
                    .brand("Fujifilm")
                    .description("14 Megapixels. 18.0 x Optical Zoom. 3.0-inch LCD Screen. Full HD photos and 1280 x 720p HD movie capture. ISO sensitivity ISO6400 at reduced resolution. Tracking Auto Focus. Motion Panorama Mode. Face Detection technology with Blink detection and Smile and shoot mode. 4 x AA batteries not included. WxDxH 110.2 Ã—81.4x73.4mm. Weight 0.341kg (excluding battery and memory card). Weight 0.437kg (including battery and memory card).")
                    .category(ProductCategory.ELECTRONICS)
                    .productImagesBas64(List.of("",
                            "",
                            ""))
                    .colors(List.of(Colors.BLACK, Colors.BLUE, Colors.WHITE))
                    .selected(false)
                    .dimension(dimension)
                    .status(ProductStatus.AVAILABLE)
                    .name("S2950 Digital Camera")
                    .build();
            createProduct(product , price) ;
        }

        for (int i = 0; i < 5; i++) {
            Price price = Price.builder().currency(Currency.MAD)
                    .price((long) (Math.random() * 100 + 100))
                    .symbol("MAD")
                    .build();
            Product product = Product.builder()
                    .productPrice(price)
                    .dimension(dimension)
                    .brand("none")
                    .description("14 Megapixels. 18.0 x Optical Zoom. 3.0-inch LCD Screen. Full HD photos and 1280 x 720p HD movie capture. ISO sensitivity ISO6400 at reduced resolution. Tracking Auto Focus. Motion Panorama Mode. Face Detection technology with Blink detection and Smile and shoot mode. 4 x AA batteries not included. WxDxH 110.2 Ã—81.4x73.4mm. Weight 0.341kg (excluding battery and memory card). Weight 0.437kg (including battery and memory card).")
                    .category(ProductCategory.CLOTHES)
                    .productImagesBas64(List.of("",
                            "",
                            ""))
                    .colors(List.of(Colors.BLACK, Colors.BLUE, Colors.WHITE))
                    .selected(true)
                    .status(ProductStatus.AVAILABLE)
                    .name("Flat ankle boots")
                    .build();
            createProduct(product , price) ;
        }


    }

    @Override
    public PageInfo getProductPageInfo(int size) {
        PageInfo pageInfo = PageInfo.builder()
                .totalElements(this.productRepo.findAll().size())
                .totalPages(this.productRepo.findAll(PageRequest.of(0, size)).getTotalPages())
                .size(size)
                .build();
        return pageInfo;
    }
}
